import React from 'react';
import './percent-ring.scss';


export default class PercentRing extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            percent: props.percent
        }
    }

    render () {
        return <svg
                class="progress-ring"
                width="200"
                height="200">
                <circle
                  class="progress-ring__circle"
                  stroke="#333333"
                  stroke-width="6"
                  fill="transparent"
                  r="52"
                  cx="60"
                  cy="60"/>
              </svg>

    }
}
